"<div>\n<i class=\"NoteType\">\nSource text\n</i>\n<div class=\"grampsstylednote\">\n<p>\n<strong>Teko\u00e4lyn hallusinoimaa teksti\u00e4! Mit\u00e4\u00e4n oikeaa l\u00e4hdett\u00e4 v\u00e4itteille ei ole l\u00f6ytynyt, ja kuulostaa muutenkin kaikin puolin keksitylt\u00e4.</strong>\n</p>\n<p>\n1830-luku oli Siltasaaressa muutosten aikaa. Vanha H\u00e4meentie kunnostettiin ja sillat linjattiin Unioninkadun suoraksi jatkeeksi vuonna 1832. T\u00e4m\u00e4 paransi saaren liikenneyhteyksi\u00e4 ja houkutteli varakkaita porvareita rakentamaan sinne huviloita ja kes\u00e4asuntoja.\n</p>\n<p>\nKuuluisin n\u00e4ist\u00e4 huviloista oli Gula Villan (Keltainen huvila), jonka kauppias Johan Fredrik Hackman rakennutti vuonna 1848. H\u00e4n oli my\u00f6s yksi Sveaborgin linnoituksen perustajista ja Suomen ensimm\u00e4isen h\u00f6yrylaivan omistajista. H\u00e4n kuoli kuitenkin jo seuraavana vuonna.\n</p>\n<p>\nGula Villan siirtyi Hackmanin kuoleman j\u00e4lkeen useiden tunnettujen sukujen omistukseen, kuten von Wrighteille, Borgstr\u00f6meille ja L\u00f6nnbohmeille. Se oli my\u00f6s kulttuurinen keskus, jossa pidettiin kirjallisia salongeja, konsertteja ja n\u00e4yttelyit\u00e4. Siell\u00e4 vierailivat muun muassa Zacharias Topelius, Jean Sibelius ja Akseli Gallen-Kallela.\n</p>\n<p>\nGula Villan purettiin vuonna 1913 Lars Sonckin suunnitteleman uuden asuinkerrostalon tielt\u00e4. Sen paikalla on nyky\u00e4\u00e4n osoite H\u00e4meentie 2.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n<i class=\"NoteType\">\nResearch\n</i>\n<div class=\"grampsstylednote\">\n<p>\n1855 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106353241/5728708528/822<br />\n1856 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106370350/5646443436/697<br />\n1857 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106384744/5321369633/767<br />\n1858 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106400539/5672354319/586<br />\n1859 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106413238/5272414717/924<br />\n1860 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106432275/6189709949/807<br />\n1861 henkikirjassa Lang\u00e9en Gula Villan https://digihakemisto.net/item/2106449512/5321402690/787<br />\n1862 henkikirjassa Lang\u00e9en Gula Willan, ei l\u00f6ydy \"Gloviken\" https://digihakemisto.net/item/2106466065/5638268994/843<br />\n1863 henkikirjassa Lang\u00e9en Gloviken, ei l\u00f6ydy \"Gula Willan\" https://digihakemisto.net/item/2106484215/5686562909/978<br />\n1864 henkikirjassa Lang\u00e9en Gloviken https://digihakemisto.net/item/2106504498/5686614934/963<br />\n1865 henkikirjassa Lang\u00e9en Gloviken (alla lis\u00e4ys ehk\u00e4 Bredviken) https://digihakemisto.net/item/2106525843/6189777699/1098<br />\n1866 henkikirjassa Lang\u00e9en Gloviken https://digihakemisto.net/item/2106606547/5666900352/840<br />\n1867 henkikirjassa Lang\u00e9en Broholmen Gloviken https://digihakemisto.net/item/2106606547/5666900352/840<br />\n1868 henkikirjassa Lang\u00e9en Broholmen Gloviken https://digihakemisto.net/item/2106642856/5338221206/752<br />\n1869 henkikirjassa Lang\u00e9en Gloviken https://digihakemisto.net/item/2106679954/5298908480/830<br />\n1870 henkikirjassa Lang\u00e9en Gloviken Bredvik Broholmen https://digihakemisto.net/item/2106700678/6189822012/1315<br />\n1871 henkikirjassa Lang\u00e9en Gloviken och Broholmen: Bredvik https://digihakemisto.net/item/2106751690/5686508762/623<br />\n1872 henkikirjassa Lang\u00e9en Gloviken \u00e5 Broholmen: Bredvik https://digihakemisto.net/item/2106781925/5298904371/560\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
